import React from 'react';
import results from './results';

const Result = () => {
    console.log(results[0].show.image.medium)
    return (
        <ul>
            {results.map((movie)=>(
                <li key={movie.show.id} alt="image">
                    <div>
                    Movie title: {movie.show.name}
                    </div>
                    <div></div>
                    Movie rating: {movie.show.rating.average}
                    <img src={movie.show.image.medium}/>
                </li>
            ))}
        </ul>
    ); 
};

export default Result;
